def download_img(image_url,cat,file_name):
    file_store = f'./images/{cat}/'
    if not os.path.exists(file_store):
        os.makedirs(file_store)
    try:
        res = requests.get(image_url, stream=True, headers=headers)
        with open(os.path.join(file_store, file_name), 'wb') as the_image:
            for chunk in res.iter_content(chunk_size=4096 * 4):
                the_image.write(chunk)
    except:
        pass
soup = BeautifulSoup(res, 'lxml')
# print(soup.prettify())
urlhref = soup.find_all('a', class_='product-item')
print(len(urlhref))
#print(urlhref)
for ele in urlhref:
    detail_url = ele.get('href')
    cat =detail_url.split('/')[-1]
    # print(len(cat))
    print(f'downding...{cat}')
    res = requests.get(f'https://sieuthibanve.com{detail_url}', headers=headers)
    soup1 = BeautifulSoup(res.text, 'lxml')
    imgtag = soup1.find_all('img')
    i = 0;
    for el in imgtag:
        i+=1
        url_img = el['src']
        #print(url_img)
        file_name = f'anh{i}.jpg'
        download_img(url_img,cat,file_name)
    print('done')

